import React from 'react';
import { useSelector, useDispatch } from 'react-redux';

function CoinList({ coins }) {
    console.log('coins', coins);
    return (
        <ul>{
            coins.data.map((coin) => (
                <li key={`coinList-${coin}`}>
                    {coin}
                </li>
            ))
        }
        </ul>
    )
}

export default CoinList;
